import logo from './opm.png';
import './App.css';

function App() {
  return (
    <div className="App">

    <div className="App-logo">
       <img src={logo} alt="Mr. Saitama" />
    </div>

      <header className="App-header">

        <p>
          Hey, I'm <b>Aedriane</b>.
          IT Engineer and aspiring Cloud guru.</p>







      </header>
    </div>
  );
}

export default App;
